    timer_sink_self->_lf_in = (sink_in_t*)&timer_delay_self->_lf_out;
    // END Connect inputs and outputs for reactor Timer.sink.
    // Connect inputs and outputs for reactor Timer.node.
    // Connect Timer.source.out to port Timer.node.in
    timer_node_self->_lf_in = (node_in_t*)&timer_source_self->_lf_out;
    // END Connect inputs and outputs for reactor Timer.node.
    // Connect inputs and outputs for reactor Timer.delay.
    // Connect Timer.node.out to port Timer.delay.inp
    timer_delay_self->_lf_inp = (_lf_gendelay_197ef_inp_t*)&timer_node_self->_lf_out;
