    // deadline 140737488355327 shifted left 16 bits.
    timer_source_self->_lf__reaction_0.index = 0x7fffffffffff0000LL;
    timer_sink_self->_lf__reaction_0.chain_id = 1;
    // index is the OR of level 1 and 
